import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
  avatarIncome: {
    backgroundColor: "rgba(75, 192, 192, 0.75)",
  },
  avatarExpense: {
    backgroundColor: "rgba(255, 99, 132, 0.75)",
  },
  avatarSaving: {
    backgroundColor: "rgba(54, 162, 235, 0.75)"
  },
}));
